    true,nt"url": null,nt"notes": "The Risk Management Agency (RMA) Summary
    of Business includes a variety of reports, data files, and an application that provide
    insurance experience for commodities grown and insured.  This includes the most
    current information, some national reports, and the ability to create ad-hoc queries.
    Data for the past five years, which is updated each Monday, includes all of the
    business data that has been validated and accepted throughout the previous week
    with a cutoff every Friday.  Data for the older years is static and no longer updated.",nt"license_title":
